CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "flight_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "flight_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "flight_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "flight_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "flight_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "flight_passenger" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "first_name" varchar(64) NOT NULL, "last_name" varchar(64) NOT NULL, "gender" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "flight_place" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "city" varchar(64) NOT NULL, "airport" varchar(64) NOT NULL, "code" varchar(3) NOT NULL, "country" varchar(64) NOT NULL);
CREATE TABLE IF NOT EXISTS "flight_week" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "number" integer NOT NULL, "name" varchar(16) NOT NULL);
CREATE TABLE IF NOT EXISTS "flight_ticket" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ref_no" varchar(6) NOT NULL UNIQUE, "flight_ddate" date NULL, "flight_adate" date NULL, "flight_fare" real NULL, "other_charges" real NULL, "coupon_used" varchar(15) NOT NULL, "coupon_discount" real NOT NULL, "total_fare" real NULL, "seat_class" varchar(20) NOT NULL, "booking_date" datetime NOT NULL, "mobile" varchar(20) NOT NULL, "email" varchar(45) NOT NULL, "status" varchar(45) NOT NULL, "flight_id" integer NULL REFERENCES "flight_flight" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "flight_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "flight_ticket_passengers" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ticket_id" integer NOT NULL REFERENCES "flight_ticket" ("id") DEFERRABLE INITIALLY DEFERRED, "passenger_id" integer NOT NULL REFERENCES "flight_passenger" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "flight_flight_depart_day" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "flight_id" integer NOT NULL REFERENCES "flight_flight" ("id") DEFERRABLE INITIALLY DEFERRED, "week_id" integer NOT NULL REFERENCES "flight_week" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "flight_flight" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "depart_time" time NOT NULL, "duration" bigint NULL, "arrival_time" time NOT NULL, "plane" varchar(24) NOT NULL, "airline" varchar(64) NOT NULL, "economy_fare" real NULL, "business_fare" real NULL, "first_fare" real NULL, "destination_id" integer NOT NULL REFERENCES "flight_place" ("id") DEFERRABLE INITIALLY DEFERRED, "origin_id" integer NOT NULL REFERENCES "flight_place" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "flight_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
